BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `Top250People` (
	`pp_id`	INT NOT NULL,
	`pp_name`	VARCHAR,
	`pp_alt`	VARCHAR,
	`pp_avatars`	VARCHAR,
	PRIMARY KEY(`pp_id`)
);
CREATE TABLE IF NOT EXISTS `Top250Movie` (
	`movie_id`	INT NOT NULL,
	`title`	VARCHAR,
	`original_title`	VARCHAR,
	`alt`	VARCHAR,
	`rating`	FLOAT,
	`year`	INT,
	`collect_count`	INT,
	`genres`	VARCHAR,
	`images`	VARCHAR,
	`directors`	VARCHAR,
	`casts`	VARCHAR,
	PRIMARY KEY(`movie_id`)
);
COMMIT;
